public class SortCharactersByFrequency_451 {
    
    public static void main(String[] args)
    {
        String a="";
        String b="";
        String c="";
        String d="";
        System.out.println(frequencySort(a+b+c+d));
    }
    
    //124ms
    public static String frequencySort(String s) {
        if(s==null || s.length()==0){return "";}
        //tree
        //eert
        //eetr
        HashMap<Character,Integer> hm = new HashMap<Character,Integer>();
        for(int i=0;i<s.length();i++)
        {
            char key = s.charAt(i);
            if(hm.containsKey(key))
            {
                hm.put(key, hm.get(key)+1);
            }
            else
            {
               hm.put(key, 1);
            }
        }
        System.out.println(hm);
        
        class Pair 
        {
            String key;
            int val;
            
            Pair(char k, int v)
            {
                StringBuilder sb= new StringBuilder();
                
                for(int i=0; i<v;i++)
                {
                    sb.append(k);
                    //key+=k;
                }
                key=sb.toString();
                val = v;
            }
        }
        
        List<Pair> list = hm.entrySet().stream().map(m->new Pair(m.getKey(),m.getValue())).sorted((a,b)->b.val-a.val).collect(Collectors.toList());
        return list.stream().map(m->m.key).reduce("",(a,b)->a+b);
}

    
    //162ms
    public static String frequencySort2(String s) {
    if(s==null || s.length()==0){return "";}
        //tree
        //eert
        //eetr
        HashMap<Character,Integer> hm = new HashMap<Character,Integer>();
        for(int i=0;i<s.length();i++)
        {
            char key = s.charAt(i);
            if(hm.containsKey(key))
            {
                hm.put(key, hm.get(key)+1);
            }
            else
            {
               hm.put(key, 1);
            }
        }
        //System.out.println(hm);
        
        return hm.entrySet().stream().sorted((a,b)->b.getValue()-a.getValue()).map(m->{
            StringBuilder sb= new StringBuilder();
            int length = m.getValue();
            char key = m.getKey();
            for(int i=0; i<length;i++)
            {
                sb.append(key);
                //key+=k;
            }
            return sb.toString();
        }).reduce("",(a,b)->a+b);
    }    
}